@unir.rondonia segurança se faz assim: com resposta RÁPIDA diante das intercorrências. “Abrir processo no SEI”, não previne crime. 
Parabéns ao @governoro e à briosa @pmro_oficial  pela resposta rápida. 
Espero que os sangue azul sejam bem recebidos na instituição que minha filha estuda, ao invés de serem recebidos com a tradicional hostilidade.

Algumas ideias para a SEGURANÇA E PROTEÇÃO NAS ESCOLAS que os Deputados da Assembleia Legislativa de Rondônia poderiam iniciar:
1. Sugerir a criação de um Comitê Permanente de Segurança e Proteção Escolar;
2. Definição de Políticas Públicas de Segurança e Proteção Escolar;
3. Definição legal do perímetro de segurança escolar;
4.  Apoiar iniciativas para o treinamento nas escolas a respeito do Protocolo CORRA, ESCONDA-SE, LUTE;
5. PROPOR AUDIÊNCIA PÚBLICA sobre segurança e proteção escolar, onde poderíamos debater alguns assuntos como:
- Padronização de procedimento das escolas em casos de violência e demais crimes tentados ou praticados por alunos contra professores;
-Definição legal sobre o monitoramento e vigilância com câmeras nas escolas, assim como uso de câmeras dentro da sala e outras áreas internas e externas da escola;
-Portas de sala de aula com chave e fechadura em perfeito estado de uso;
Entre vários outros assuntos.
Estou a disposição para conversar sobre essas sugestões e demais ideias.
SGT PM Botelho
